import { useEffect, useState } from "react";

function App() {
  const [products, setProducts] = useState([]);
  const [view, setView] = useState("list"); // list | add
  const [product, setProduct] = useState({
    boxBarcode: "",
    productBarcode: "",
    name: "",
    spec: "",
    stock: 0,
  });

  const fetchProducts = async () => {
    try {
      const res = await fetch("http://localhost:3001/api/products");
      const data = await res.json();
      setProducts(data);
    } catch (err) {
      alert("无法获取产品列表");
    }
  };

  useEffect(() => {
    fetchProducts();
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProduct((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async () => {
    if (!product.productBarcode || !product.name) {
      alert("产品条码和名称不能为空");
      return;
    }
    try {
      const res = await fetch("http://localhost:3001/api/products", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(product),
      });
      if (res.ok) {
        alert("保存成功");
        setProduct({ boxBarcode: "", productBarcode: "", name: "", spec: "", stock: 0 });
        fetchProducts();
        setView("list");
      } else {
        alert("保存失败");
      }
    } catch (err) {
      alert("网络错误");
    }
  };

  return (
    <div className="min-h-screen bg-gray-100 p-4">
      <div className="flex justify-between items-center mb-4">
        <h1 className="text-2xl font-bold">仓库库存系统</h1>
        <div>
          <button
            onClick={() => setView("list")}
            className="bg-gray-300 text-black px-3 py-1 rounded mr-2"
          >库存列表</button>
          <button
            onClick={() => setView("add")}
            className="bg-blue-500 text-white px-3 py-1 rounded"
          >入库</button>
        </div>
      </div>

      {view === "list" && (
        <div className="overflow-x-auto">
          <table className="min-w-full bg-white rounded-xl overflow-hidden shadow">
            <thead>
              <tr className="bg-gray-200 text-left">
                <th className="p-2">产品条码</th>
                <th className="p-2">名称</th>
                <th className="p-2">规格</th>
                <th className="p-2">库存数</th>
              </tr>
            </thead>
            <tbody>
              {products.map((item) => (
                <tr key={item._id} className="border-t">
                  <td className="p-2">{item.productBarcode}</td>
                  <td className="p-2">{item.name}</td>
                  <td className="p-2">{item.spec}</td>
                  <td className="p-2">{item.stock}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}

      {view === "add" && (
        <div className="bg-white p-4 rounded-xl shadow max-w-md mx-auto">
          <h2 className="text-xl font-semibold mb-4">产品入库</h2>
          <div className="space-y-4">
            <input
              name="boxBarcode"
              placeholder="箱子条码（可选）"
              value={product.boxBarcode}
              onChange={handleChange}
              className="w-full border border-gray-300 p-2 rounded"
            />
            <input
              name="productBarcode"
              placeholder="产品条码（必填）"
              value={product.productBarcode}
              onChange={handleChange}
              className="w-full border border-gray-300 p-2 rounded"
            />
            <input
              name="name"
              placeholder="产品名称"
              value={product.name}
              onChange={handleChange}
              className="w-full border border-gray-300 p-2 rounded"
            />
            <input
              name="spec"
              placeholder="规格（如 500g*12）"
              value={product.spec}
              onChange={handleChange}
              className="w-full border border-gray-300 p-2 rounded"
            />
            <input
              name="stock"
              type="number"
              placeholder="库存数量"
              value={product.stock}
              onChange={handleChange}
              className="w-full border border-gray-300 p-2 rounded"
            />
            <button
              onClick={handleSubmit}
              className="w-full bg-blue-600 text-white py-2 rounded hover:bg-blue-700"
            >保存</button>
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
